import React, { useMemo, useEffect, useState } from 'react'

import TextField from '@mui/material/TextField'
import Autocomplete from '@mui/material/Autocomplete'
import axios from 'axios'

const SelectPlayer = (props) => {
  const array = []
  const handlerClick = props.handlerClick

  const data = props.data.map((element) => {
    return {
      playerName: element.playerName,
    }
  })

  useEffect(() => {
    props.handlerClick();
  }, [])

  array.push(props.data)
  return (
    <div className='selectPlayerContainer'>
      <button onClick={handlerClick}>ADD data</button>
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={data}
        // getOptionLabel={(option) => (option ? option.playerName : '')}
        sx={{ width: 300 }}
        renderInput={(params) => (
          <TextField {...params} label="Select Player" />
        )}
      />
    </div>
  )
}

export default SelectPlayer
